import React, { ReactNode } from 'react';
import './App.css';

interface SectionProps {
    id: string;
    title: string;
    imgSrc: string;
    children: ReactNode;
  }
  
  const Section: React.FC<SectionProps> = ({ id, title, imgSrc, children }) => {
    return (
      <section id={id} className={`${id}`}>
        <img src={imgSrc} alt={title} className={`${id}-img`} />
        <h2>{title}</h2>
        <div className={`${id}-content`}>
          {children}
        </div>
      </section>
    );
  };
  
  export default Section;
